import React from 'react';
import { useOutletContext } from 'react-router-dom';

export default function CustomerHistoryPage() {
  const { customerHistory } = useOutletContext();

  return (
    <div className="widget">
      <h3>Customer Purchase History</h3>
      <table border="1" cellPadding="8" style={{ borderCollapse: 'collapse', width: '100%', marginTop: '20px' }}>
        <thead>
          <tr>
            <th>Customer</th>
            <th>Email</th>
            <th>Order IDs</th>
          </tr>
        </thead>
        <tbody>
          {customerHistory.map(customer => (
            <tr key={customer.id}>
              <td>{customer.name}</td>
              <td>{customer.email}</td>
              <td>
                {customer.orders.length > 0
                  ? <ul>{customer.orders.map(orderId => <li key={orderId}>{orderId}</li>)}</ul>
                  : 'No orders found'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
